import React, { FunctionComponent } from "react";
import { Link, Outlet } from "react-router-dom";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Avatar from "@mui/material/Avatar";
import IconButton from "@mui/material/IconButton";
import ListAltIcon from "@mui/icons-material/ListAlt";
import colorFormat from "../headers/color-format";
import AppMenu from "../pages/app-menu";
import DishList from "../pages/dish-list";
import { ExitToApp, RestaurantMenu } from "@mui/icons-material";

const NavBar: FunctionComponent = () => {
  /* <nav>
      <Link to="/"> Accueil</Link>
      <Link to="/menu">Menu</Link>
      <Link to="/exit">Exit</Link>
    </nav> */
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar
        position="static"
        style={{ backgroundColor: colorFormat("primary") }}
      >
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <RestaurantMenu />
            <ListAltIcon />
          </IconButton>
          <Typography variant="h5" component="div" sx={{ flexGrow: 1 }}>
            Menu
          </Typography>
          <Avatar src="/broken-image.jpg" />
          <ExitToApp />
        </Toolbar>
      </AppBar>
    </Box>
  );
};

export default NavBar;
